/*
 * app boot file
 * @author baoym(hzbaoyongming@corp.netease.com)
 */

'use strict';

let path = require('path');
var Server = require('be-modules').server;
var onerror = require('./server/error/error');

let argObject = {};
for (let i = 2; i < process.argv.length; i++) {
    if (process.argv[i].startsWith('-')) {
        argObject[process.argv[i].replace(/-/g, '')] = process.argv[++i];
    } else {
        argObject[process.argv[i]] = true;
    }
}

const isOnline = argObject.m === 'online';
const isTest = argObject.m === 'test';
process.isOnline = isOnline;
process.appConfig = isOnline ? require('be-modules').onlineConfig :
                    isTest ?  require('be-modules').testConfig : require('be-modules').developConfig;

let server = new Server({
    port: process.env.PORT || argObject.p || 8082,
    controller: {
        web: path.join(__dirname, './server/controller/web'),
        api: path.join(__dirname, './server/controller/api')
    },
    filter:  path.join(__dirname, './server/filter/'),
    serverRoot: __dirname,
    webRoot: './public',
    viewRoot: isOnline||isTest ? './template' : './view',
    uploadRoot: './uploads',
    loggerRoot: './log',
    onerror: onerror
}).on('error', function(err, ctx) {
    console.log(err.stack);
});

global.logger = server.logger;
